package day2;

public class Oper1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
			boolean check = 10>9;
		
			System.out.println(10 == 11);
			System.out.println(10 != 11);
			System.out.println(10 > 9);
			System.out.println(check);
			System.out.println(check && 10==11);
			System.out.println(check && 10==11);
			System.out.println(check || !(10==11));
			
	}

}
